import { Link } from "react-router-dom";

const Card = ({ id, name, species, gender, image, onClose }) => {
  return (
    <div>
      <button onClick={() => onClose(id)}>X</button>}
      <Link>
        <h2>{name}</h2>
      </Link>
      <h2>{species}</h2>
      <h2>{gender}</h2>
      <img src={image} alt="" />
    </div>
  );
};

export default Card;
